import React from "react";
// Import Component MUI
import { Button, Grid } from "@mui/material";

export default function Buttons() {
  return (
    <>
      {/* Button */}
      <Grid container justifyContent="right">
        <Grid item align="right" xs={12} md={12} lg={12}>
          <Button
            variant="contained"
            color="warning"
            sx={{
              mt: 5,
              mb: 3,
              width: "50",
              height: "50",
              fontSize: 20,
            }}
          >
            +
          </Button>
        </Grid>
      </Grid>
    </>
  );
}
